import logo from './logo.svg';
import './App.css';
import {Component} from 'react';

class App extends Component {
  constructor(){
    super();

    this.state={
      monster1:{
        name: 'Linda'
      },
      monster2:{
        name: 'Frank'
      },
      monster3:{
        name: 'Jacky'
      }

    };

  }

  render(){
    return (
      <div className="App">
        <div className = "Monster1">
          <h1>Monster {this.state.monster1.name}</h1>
        </div>
        <div className = "Monster2">
          <h1>Monster {this.state.monster2.name}</h1>
        </div>
        <div className = "Monster3">
          <h1>Monster {this.state.monster3.name}</h1>
        </div>

      </div>
    )
  }

}

export default App;
